dia.org\/wiki\/%D0%9C%D1%8B%D1%81_%D0%94%D0%BE%D0%B1%D1%80%D0%BE%D0%B9_%D0%9D%D0%B0%D0%B4%D0%B5%D0%B6%D0%B4%D1%8B\" title=\"\u041c\u044b\u0441 \u0414\u043e\u0431\u0440\u043e\u0439 \u041d\u0430\u0434\u0435\u0436\u0434\u044b\">\u043c\u044b\u0441 \u0414\u043e\u0431\u0440\u043e\u0439 \u041d\u0430\u0434\u0435\u0436\u0434\u044b<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1542_%D0%B3%D0%BE%D0%B4\" title=\"1542 \u0433\u043e\u0434\">1542<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%81%D0%BF%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0418\u0441\u043f\u0430\u043d\u0438\u044f\">\u0418\u0441\u043f\u0430\u043d\u0438\u044f<\/a> \u043e\u0433\u0440\u0430\u043d\u0438\u0447\u0438\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B0%D0%B1%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u0420\u0430\u0431\u0441\u0442\u0432\u043e\">\u0440\u0430\u0431\u0441\u0442\u0432\u043e<\/a> \u0432 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0445 \u043a\u043e\u043b\u043e\u043d\u0438\u044f\u0445.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1604_%D0%B3%D0%BE%D0%B4\" title=\"1604 \u0433\u043e\u0434\">1604<\/a>&#160;\u2014 26-\u043b\u0435\u0442\u043d\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D1%80%D0%BE%D0%BB%D1%8C\" title=\"\u041a\u043e\u0440\u043e\u043b\u044c\">\u043a\u043e\u0440\u043e\u043b\u044c<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%81%D0%BF%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0418\u0441\u043f\u0430\u043d\u0438\u044f\">\u0418\u0441\u043f\u0430\u043d\u0438\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%B8%D0%BB%D0%B8%D0%BF%D0%BF_III_%D0%98%D1%81%D0%BF%D0%B0%D0%BD%D1%81%D0%BA%D0%B8%D0%B9\" class=\"mw-redirect\" title=\"\u0424\u0438\u043b\u0438\u043f\u043f III \u0418\u0441\u043f\u0430\u043d\u0441\u043a\u0438\u0439\">\u0424\u0438\u043b\u0438\u043f\u043f III<\/a>, \u0432 \u0447\u044c\u0451 \u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u0435 \u043f\u0440\u0438\u0434\u0432\u043e\u0440\u043d\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D1%82%D0%B8%D0%BA%D0%B5%D1%82\" title=\"\u042d\u0442\u0438\u043a\u0435\u0442\">\u044d\u0442\u0438\u043a\u0435\u0442<\/a> \u0431\u044b\u043b \u0434\u043e\u0432\u0435\u0434\u0451\u043d \u0434\u043e \u043d\u0435\u043c\u044b\u0441\u043b\u0438\u043c\u043e\u0433\u043e \u0441\u043e\u0432\u0435\u0440\u0448\u0435\u043d\u0441\u0442\u0432\u0430, \u043e\u0431\u0433\u043e\u0440\u0435\u043b, \u0437\u0430\u0441\u043d\u0443\u0432 \u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BC%D0%B8%D0%BD\" title=\"\u041a\u0430\u043c\u0438\u043d\">\u043a\u0430\u043c\u0438\u043d\u0430<\/a>, \u043f\u043e\u0442\u043e\u043c\u0443 \u0447\u0442\u043e \u043d\u0435 \u043c\u043e\u0433\u043b\u0438 \u043e\u0442\u044b\u0441\u043a\u0430\u0442\u044c \u0442\u043e\u0433\u043e \u0435\u0434\u0438\u043d\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D0%B0%D0%BD%D0%B4_(%D1%82%D0%B8%D1%82%D1%83%D0%BB)\" title=\"\u0413\u0440\u0430\u043d\u0434 (\u0442\u0438\u0442\u0443\u043b)\">\u0433\u0440\u0430\u043d\u0434\u0430<\/a>, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u0438\u043c\u0435\u043b \u043f\u0440\u0430\u0432\u043e \u043f\u043e\u0434\u0432\u0438\u043d\u0443\u0442\u044c \u043a\u0440\u0435\u0441\u043b\u043e \u043a\u043e\u0440\u043e\u043b\u044f.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1621_%D0%B3%D0%BE%D0%B4\" title=\"1621 \u0433\u043e\u0434\">1621<\/a>&#160;\u2014 \u043d\u0430\u0441\u0442\u043e\u044f\u0442\u0435\u043b\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B1%D0%BE%D1%80_%D0%A1%D0%B2%D1%8F%D1%82%D0%BE%D0%B3%D0%BE_%D0%9F%D0%B0%D0%B2%D0%BB%D0%B0\" title=\"\u0421\u043e\u0431\u043e\u0440 \u0421\u0432\u044f\u0442\u043e\u0433\u043e \u041f\u0430\u0432\u043b\u0430\">\u043b\u043e\u043d\u0434\u043e\u043d\u0441\u043a\u043e\u0433\u043e \u0441\u043e\u0431\u043e\u0440\u0430 \u0441\u0432. \u041f\u0430\u0432\u043b\u0430<\/a> 