u0421\u0421\u0421\u0420<\/a> \u043f\u043e\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B2%D0%B5%D1%82_%D0%BD%D0%B0%D1%80%D0%BE%D0%B4%D0%BD%D1%8B%D1%85_%D0%BA%D0%BE%D0%BC%D0%B8%D1%81%D1%81%D0%B0%D1%80%D0%BE%D0%B2_%D0%A1%D0%A1%D0%A1%D0%A0\" title=\"\u0421\u043e\u0432\u0435\u0442 \u043d\u0430\u0440\u043e\u0434\u043d\u044b\u0445 \u043a\u043e\u043c\u0438\u0441\u0441\u0430\u0440\u043e\u0432 \u0421\u0421\u0421\u0420\">\u0421\u043e\u0432\u043d\u0430\u0440\u043a\u043e\u043c\u0430<\/a> \u0440\u0430\u0437\u0440\u0435\u0448\u0451\u043d \u0438\u0441\u043a\u0443\u0441\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B1%D0%BE%D1%80%D1%82\" title=\"\u0410\u0431\u043e\u0440\u0442\">\u0430\u0431\u043e\u0440\u0442<\/a>, \u0435\u0441\u043b\u0438 \u043f\u0440\u043e\u0434\u043e\u043b\u0436\u0435\u043d\u0438\u0435 \u0431\u0435\u0440\u0435\u043c\u0435\u043d\u043d\u043e\u0441\u0442\u0438 \u0443\u0433\u0440\u043e\u0436\u0430\u0435\u0442 \u0436\u0438\u0437\u043d\u0438 \u043c\u0430\u0442\u0435\u0440\u0438 .<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1938_%D0%B3%D0%BE%D0%B4\" title=\"1938 \u0433\u043e\u0434\">1938<\/a>&#160;\u2014 \u043d\u0430 \u042e\u0436\u043d\u043e\u0430\u0444\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u043c \u0431\u0435\u0440\u0435\u0433\u0443 \u043f\u043e\u0439\u043c\u0430\u043d\u0430 \u0434\u043e\u0438\u0441\u0442\u043e\u0440\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u0440\u044b\u0431\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A6%D0%B5%D0%BB%D0%B0%D0%BA%D0%B0%D0%BD%D1%82%D0%BE%D0%BE%D0%B1%D1%80%D0%B0%D0%B7%D0%BD%D1%8B%D0%B5\" title=\"\u0426\u0435\u043b\u0430\u043a\u0430\u043d\u0442\u043e\u043e\u0431\u0440\u0430\u0437\u043d\u044b\u0435\">\u0426\u0435\u043b\u0430\u043a\u0430\u043d\u0442<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B0%D1%82%D0%B8%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D1%8F%D0%B7%D1%8B%D0%BA\" title=\"\u041b\u0430\u0442\u0438\u043d\u0441\u043a\u0438\u0439 \u044f\u0437\u044b\u043a\">\u043b\u0430\u0442.<\/a>&#160;coelacanth), \u0441\u0447\u0438\u0442\u0430\u0432\u0448\u0430\u044f\u0441\u044f \u0432\u044b\u043c\u0435\u0440\u0448\u0435\u0439.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1941_%D0%B3%D0%BE%D0%B4\" title=\"1941 \u0433\u043e\u0434\">1941<\/a>&#160;\u2014 \u043f\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%BE%D1%80%D0%BE%D0%B3%D0%B0_%D0%B6%D0%B8%D0%B7%D0%BD%D0%B8\" title=\"\u0414\u043e\u0440\u043e\u0433\u0430 \u0436\u0438\u0437\u043d\u0438\">\u0414\u043e\u0440\u043e\u0433\u0435 \u0416\u0438\u0437\u043d\u0438<\/a>, \u043f\u0440\u043e\u043b\u043e\u0436\u0435\u043d\u043d\u043e\u0439 \u0434\u043b\u044f \u0441\u043d\u0430\u0431\u0436\u0435\u043d\u0438\u044f \u0431\u043b\u043e\u043a\u0430\u0434\u043d\u043e\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u041b\u0435\u043d\u0438\u043d\u0433\u0440\u0430\u0434\u0430<\/a> \u043f\u043e \u043b\u044c\u0434\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B0%D0%B4%D0%BE%D0%B6%D1%81%D0%BA%D0%BE%D0%B5_%D0%BE%D0%B7%D0%B5%D1%80%D0%BE\" title=\"\u041b\u0430\u0434\u043e\u0436\u0441\u043a\u043e\u0435 \u043e\u0437\u0435\u0440\u043e\">\u041b\u0430\u0434\u043e\u0436\u0441\u043a\u043e\u0433\u043e \u043e\u0437\u0435\u0440\u0430<\/a>, \u0441\u0442\u0430\u043b\u0438 \u0445\u043e\u0434\u0438\u0442\u044c \u043c\u0430\u0448\u0438\u043d\u044b.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1946_%D0%B3%D0%BE%D0%B4\" title=\"1946 \u0433\u043e\u0434\">1946<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D1%8F\" title=\"\u0410\u043d\u0433\u043b\u0438\u044f\">\u0410\u043d\u0433\u043b\u0438\u0438<\/a> \u043f\u043e\u0441\u0442\u0443\u043f\u0438\u043b\u0438 \u0432 \u043f\u0440\u043e\u0434\u0430\u0436\u0443 \u043f\u0435\u0440\u0432\u044b\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B0%D1%80%D0%B8%D0%BA%D0%BE%D0%B2%D0%B0%D1%8F_%D1%80%D1%83%D1%87%D0%BA%D0%B0\" title=\"\u0428\u0430\u0440\u0438\u043a\u043e\u0432\u0430\u044f \u0440\u0443\u0447\u043a\u0430\">\u0448\u0430\u0440\u0438\u043a\u043e\u0432\u044b\u0435 \u0440\u0443\u0447\u043a\u0438<\/a> (\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D1%8C%D1%8E-%D0%99%D0%BE%D1%80%D0%BA\" title=\"\u041d\u044c\u044e-\u0419\u043e\u0440\u043a\">\u041d\u044c\u044e-\u0419\u043e\u0440\u043a\u0435<\/a> \u0448\u0430\u0440\u0438\u043a\u043e\u0432\u0430\u044f \u0440\u0443\u0447\u043a\u0430 \u043f\u043e\u0441\u0442\u0443\u043f\u0438\u043b\u0430 \u0432 \u043f\u0440\u043e\u0434\u0430\u0436\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/29_%D0%BE%D0%BA%D1%82%D1%8F%D0%B1%D1%80%D1%8F\" title=\"29 \u043e\u043a\u0442\u044f\u0431\u0440\u044f\">29 \u043e\u043a\u0442\u044f\u0431\u0440\u044f<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1945_%D0%B3%D0%BE%D0%B4\" title=\"1945 \u0433\u043e\u0434\">1945 \u0433\u043e\u0434\u0430<\/a>, \u0431\u044b\u043b\u0430 \u0437\u0430\u043f\u0430\u0442\u0435\u043d\u0442\u043e\u0432\u0430\u043d\u0430 \u0432 \u0410\u043c\u0435\u0440\u0438\u043a\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/30_%D0%BE%D0%BA%D1%82%D1%8F%D0%B1%D1%80%D1%8F\" title=\"30 \u043e\u043a\u0442\u044f\u0431\u0440\u044f\">30 \u043e\u043a\u0442\u044f\u0431\u0440\u044f<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1888_%D0%B3%D0%BE%D0%B4\" title=\"1888 \u0433\u043e\u0434\">1888 \u0433\u043e\u0434\u0430<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1956_%D0%B3%D0%BE%D0%B4\" title=\"1956 \u0433\u043e\u0434\">1956<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D0%BB%D1%8C%D0%B1%D1%83%D1%80%D0%BD\" title=\"\u041c\u0435\u043b\u044c\u0431\u0443\u0440\u043d\">\u041c\u0435\u043b\u044c\u0431\u0443\u0440\u043d\u0435<\/a> \u043d\u0430\u0447\u0430\u043b\u0438\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B5%D1%82%D0%BD%D0%B8%D0%B5_%D0%9E%D0%BB%D0%B8%D0%BC%D0%BF%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B5_%D0%B8%D0%B3%D1%80%D1%8B_1956\" title=\"\u041b\u0435\u0442\u043d\u0438\u0435 \u041e\u043b\u0438\u043c\u043f\u0438\u0439\u0441\u043a\u0438\u0435 \u0438\u0433\u0440\u044b 1956\">XVI \u041e\u043b\u0438\u043c\u043f\u0438\u0439\u0441\u043a\u0438\u0435 \u0438\u0433\u0440\u044b<\/a> (\u0442\u0443\u0440\u043d\u0438\u0440 \u043f\u043e \u043a\u043e\u043d\u043d\u043e\u043c\u0443 \u0441\u043f\u043e\u0440\u0442\u0443 \u043f\u0440\u043e\u0448\u0451\u043b \u0432 \u0438\u044e\u043d\u0435 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D0%BE%D0%BA%D0%B3%D0%BE%D0%BB%D1%8C%D0%BC\" title=\"\u0421\u0442\u043e\u043a\u0433\u043e\u043b\u044c\u043c\">\u0421\u0442\u043e\u043a\u0433\u043e\u043b\u044c\u043c\u0435<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1957_%D0%B3%D0%BE%D0%B4\" title=\"1957 \u0433\u043e\u0434\">1957<\/a>&#160;\u2014 \u0433\u043e\u0441\u0442\u044f\u043c\u0438 \u043c\u0443\u0437\u044b\u043a\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u0442\u0435\u043b\u0435\u0448\u043e\u0443 \u00abAmerican Bandstand\u00bb \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/American_Broadcasting_Company\" title=\"American Broadcasting Company\">\u043a\u0430\u043d\u0430\u043b\u0435 \u00abABC\u00bb<\/a> \u0441\u0442\u0430\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D1%83%D1%8D%D1%82\" title=\"\u0414\u0443\u044d\u0442\">\u0434\u0443\u044d\u0442<\/a> \u00ab\u0422\u043e\u043c \u0438 \u0414\u0436\u0435\u0440\u0440\u0438\u00bb \u0441\u043e \u0441\u0432\u043e\u0438\u043c \u043f\u0435\u0440\u0432\u044b\u043c \u0445\u0438\u0442\u043e\u043c \u00abHey, Schoolgirl\u00bb. \u041d\u043e \u0440\u0430\u0437\u0432\u0438\u0442\u044c \u0443\u0441\u043f\u0435\u0445 \u043c\u0443\u0437\u044b\u043a\u0430\u043d\u0442\u0430\u043c, \u043d\u0430\u0437\u044b\u0432\u0430\u0432\u0448